import Nav from "./Nav";
import NavList from "./NavList";
import NavItem from "./NavItem";
import NavLink from "./NavLink";
import NavSeparator from "./NavSeparator";

Nav.List = NavList;
Nav.Item = NavItem;
Nav.Link = NavLink;
Nav.Separator = NavSeparator;

export default Nav;
